import Suggestions from './Suggestions'

const SuggestionBox = ({text}) => {
    const renderSuggestions = () => {
        const filteredData = Suggestions.filter((data) => {
            if(data.includes(text)){
                return true
            }
        })
    }


    return (
        <>
            {renderSuggestions()}
        </>
    )
}

export default SuggestionBox
